import React,{Component} from 'react';
import Person from './persons'

function NameList(){
	const persons = [
		'Diana',
		'Bruce']
		const List = persons.map(person =><Person props = {person} />)
		return (
			<div>
                 {List}
            </div>
			)
}	
export default NameList
